    {

        id:2,
        title:'title two',
        desc:'title description two....'
        }

    ]
    


function Home() {
  const [todos,setTodos] = useState([]);
  return (
    <div className={style.container}>
      <h1 style={{color:'white'}}>Todo App</h1>
      <NewTodo/>
      <Todos  todos={todos} />
    </div>
  )
}

export default Home
